type readDirFS struct {
	fs.FS

	reads map[string]int
}

func (f *readDirFS) ReadDir(name string) ([]fs.DirEntry, error) {
	f.reads[name] = f.reads[name] + 1
	return fs.ReadDir(f.FS, name)
}

func testGlob(t *testing.T, fs fs.FS, includes, excludes []string, includeDirs bool) {
	if fs == nil {
		fs = fstest.MapFS{
			"a/0/aa":      &fstest.MapFile{},
			"a/1/aa":      &fstest.MapFile{},
			"b":           &fstest.MapFile{},
			"c":           &fstest.MapFile{},
			"d/0":         &fstest.MapFile{},
			"d/1/aa":      &fstest.MapFile{},
			"1/0":         &fstest.MapFile{},
			"2/0/aa/d/aa": &fstest.MapFile{},
		}
	}

	glob, err := New(includes, excludes)
	require.NoError(t, err)

	fsys := &readDirFS{FS: fs, reads: map[string]int{}}

	matches, err := fxs.TryCollect(glob.Match(fsys, ".", includeDirs))
	require.NoError(t, err)

	assert.False(t, fx.Any(maps.Values(fsys.reads), func(c int) bool { return c > 1 }))

	autogold.ExpectFile(t, map[string]any{
		"matches": matches,
		"reads":   fsys.reads,
	})
}

func TestGlobComplex(t *testing.T) {
	testGlob(t, nil, []string{"*", "a/**"}, []string{"**/1/**"}, true)
}

func TestGlobComplexFiles(t *testing.T) {
	testGlob(t, nil, []string{"*", "a/**"}, []string{"**/1/**"}, false)
}

func TestGlobComplex2(t *testing.T) {
	testGlob(t, nil, []string{"**/aa"}, []string{"**/d"}, true)
}

func TestGlobComplex2Files(t *testing.T) {
	testGlob(t, nil, []string{"**/aa"}, []string{"**/d"}, false)
}

func TestGlobAll(t *testing.T) {
	testGlob(t, nil, []string{"**"}, nil, true)
}

func TestGlobAllFiles(t *testing.T) {
	testGlob(t, nil, []string{"**"}, nil, false)
}

func TestGlobNone(t *testing.T) {
	testGlob(t, nil, []string{"**"}, []string{"**"}, true)
}

func TestGlobNoneFiles(t *testing.T) {
	testGlob(t, nil, []string{"**"}, []string{"**"}, false)
}

func TestGlobGoFiles(t *testing.T) {
	testGlob(t, goFS, []string{"**/*.go"}, nil, false)
}

func TestGlobNotGo(t *testing.T) {
	testGlob(t, goFS, []string{"**"}, []string{"**/*.go"}, false)
}

func TestGlobTestdataDeep(t *testing.T) {
	testGlob(t, goFS, []string{"**/testdata/**"}, nil, false)
}

func TestGlobTestdataShallow(t *testing.T) {
	testGlob(t, goFS, []string{"**/testdata/*"}, nil, false)
}

func TestGlobTestdataExact(t *testing.T) {
	testGlob(t, goFS, []string{"**/testdata"}, nil, true)
}

func TestGlobPrefix(t *testing.T) {
	testGlob(t, goFS, []string{"cmd/vet/testdata/**"}, nil, false)
}

func TestGlobInternalPrefix(t *testing.T) {
	testGlob(t, goFS, []string{"*/*/testdata/script/**"}, nil, false)
}

